import sys


def main():
    n, m = map(int, input().split())
    prefectures = [[] for _ in range(n+1)]
    for _ in range(m):
        p, y = map(int, input().split())
        prefectures[p].append(y)
    for p in range(1, n+1):
        prefectures[p].sort()
        for i, year in enumerate(prefectures[p]):
            print('{:0>6}{:0>6}'.format(p, i+1))


if __name__ == '__main__':
    main()

# N: number of prefectures
# M: number of cities
# P_i: prefecture number of city i
# Y_i: year of establishment of city i
N, M = map(int, input().split())

# Dictionary to store the cities per prefecture
pref = {}
for i in range(M):
    P, Y = map(int, input().split())
    if P in pref:
        pref[P].append(Y)
    else:
        pref[P] = [Y]

# Sort the cities per prefecture
for i in pref:
    pref[i].sort()

# Print the result
for i in range(M):
    P, Y = map(int, input().split())
    print("{:06d}{:06d}".format(P, pref[P].index(Y) + 1))

N, M = map(int, input().split())

year_to_prefecture = {}
for i in range(M):
    P, Y = map(int, input().split())
    if Y in year_to_prefecture:
        year_to_prefecture[Y].append(P)
    else:
        year_to_prefecture[Y] = [P]

year_list = sorted(list(year_to_prefecture.keys()))

prefecture_to_city_num = {}
for year in year_list:
    for prefecture in year_to_prefecture[year]:
        if prefecture in prefecture_to_city_num:
            prefecture_to_city_num[prefecture] += 1
        else:
            prefecture_to_city_num[prefecture] = 1

for year in year_list:
    for prefecture in year_to_prefecture[year]:
        print(str(prefecture).zfill(6) + str(prefecture_to_city_num[prefecture]).zfill(6))
